typedef struct Dwarf_Relocation_Data_s {
unsigned char drd_type;
unsigned char drd_length;
Dwarf_Unsigned drd_offset;
Dwarf_Unsigned drd_symbol_index;
} *Dwarf_Relocation_Data;

